    def parse_country(self, response):
        country_id = response.meta['country_id']
        country_name = response.meta['country_name']
        page_index = response.meta['page_index']

        if response.status != 200:
            self.logger.info(f'ERROR REQUEST STATUS: {response.status}, RESPONSE: {response.text}')
        else:
            soup = BS(response.text, "html.parser")

            ViewState = soup.find('input', {'id': 'com.salesforce.visualforce.ViewState'})['value']
            ViewStateVersion = soup.find('input', {'id': 'com.salesforce.visualforce.ViewStateVersion'})['value']
            ViewStateMAC = soup.find('input', {'id': 'com.salesforce.visualforce.ViewStateMAC'})['value']

            partners_data = soup.find('section', {'id': 'sectionResults'})
            try:
                partners_table = partners_data.find('section', {'id': 'sectionResultsTable'}).find('table').find('tbody')
            except AttributeError:
                self.logger.info(f'ERROR: Country: {country_name}, Page: {page_index}, No Partners')
                return

            partners = partners_table.find_all('tr')

            self.logger.info(f'Country: {country_name}, Page: {page_index}, Partners#: {len(partners)}')

            for partner in partners:
                partner_data = partner.find('td', {'class': 'pl-results-td-partner'}).find('a', {'class': 'pl-results-partner-name'})['onclick']

                partner_data = partner_data[partner_data.find("'parameters':"):].replace("'parameters':", '')
                partner_data = partner_data[: 1+partner_data.find('}')].replace("'", '"')
                partner_data = json.loads(partner_data)

                for k in partner_data.keys():
                    if 'cmdPartnerName' in k:
                        value = partner_data[k]
                        break

