    def parse_partner(self, response):

        if response.status != 200:
            self.logger.info(f'ERROR REQUEST STATUS: {response.status}, RESPONSE: {response.text}')
        else:
            soup = BS(response.text, "html.parser")

            # Initialize item
            item = dict()
            for k in self.item_fields:
                item[k] = ''

            item['partner_program_link'] = self.partner_program_link
            item['partner_directory'] = self.partner_directory
            item['partner_program_name'] = self.partner_program_name

            item['partner_company_name'] = soup.find('h2', {'class': 'pl-partner-name'}).text.strip()
            item['partner_tier'] = soup.find('span', {'id': 'thePage:theForm:partnerType'}).text
            if 'Solution Partner' in item['partner_tier']:
                item['partner_tier'] = item['partner_tier'].replace('Solution Partner', '').strip()

            item['company_description'] = soup.find('p', {'id': 'povDetails'}).text if soup.find('p', {'id': 'povDetails'}) else ''
            if 'Show More' in item['company_description']:
                item['company_description'] = item['company_description'][:item['company_description'].rfind('Show More')]

            partner_data = soup.find('div', {'id': 'infoLocation'})

            address = partner_data.find('li', {'class': 'list-group-item pl-location-address'}).find('span').find_all(text=True, recursive=False)
            item['headquarters_address'] = ' '.join([txt.text for txt in address])
            item['headquarters_country'] = response.meta['country_name']

            item['general_phone_number'] = partner_data.find('li', {'title': 'Phone'}).text if partner_data.find('li', {'title': 'Phone'}) else ''

            item['general_email_address'] = partner_data.find('li', {'title': 'Email'}).text if partner_data.find('li', {'title': 'Email'}) else ''

            item['company_domain_name'] = partner_data.find('li', {'title': 'Website'}).find('a', {'href': True})['href'] if partner_data.find('li', {'title': 'Website'}) else ''
            try:
                url_obj = urllib.parse.urlparse(item['company_domain_name'])
                item['company_domain_name'] = url_obj.netloc if url_obj.netloc != '' else url_obj.path
                x = re.split(r'www\.', item['company_domain_name'], flags=re.IGNORECASE)
                if x:
                    item['company_domain_name'] = x[-1]
                if '/' in item['company_domain_name']:
                    item['company_domain_name'] = item['company_domain_name'][
                                                  :item['company_domain_name'].find('/')]
            except Exception as e:
                print('DOMAIN ERROR: ', e)

            partner_info = soup.find('div', {'id': 'groupPartnerInfo'})

            item['products'] = partner_info.find('div', {'id': 'Account_Products__c'}).text if partner_info.find('div', {'id': 'Account_Products__c'}) else ''

            item['services'] = partner_info.find('div', {'id': 'Account_Services__c'}).text if partner_info.find('div', {'id': 'Account_Services__c'}) else ''

            item['specializations'] = partner_info.find('div', {'id': 'Account_Specializations__c'}).text if partner_info.find('div', {'id': 'Account_Specializations__c'}) else ''

            item['company_size'] = partner_info.find('div', {'id': 'Account_Customer_Company_Size__c'}).text if partner_info.find('div', {'id': 'Account_Customer_Company_Size__c'}) else ''

            item['solutions'] = partner_info.find('div', {'id': 'Account_Team_Function__c'}).text if partner_info.find('div', {'id': 'Account_Team_Function__c'}) else ''

            item['industries'] = partner_info.find('div', {'id': 'Account_Industry__c'}).text if partner_info.find('div', {'id': 'Account_Industry__c'}) else ''

            partner_social = soup.find('span', {'id': 'thePage:theForm:pnlSocialProfile'})
            if partner_social:
                socials = partner_social.find_all('a', {'title': True})
                for social in socials:
                    if 'LinkedIn' in social['title']:
                        item['linkedin_link'] = social['href']

                    if 'Twitter' in social['title']:
                        item['twitter_link'] = social['href']

                    if 'Facebook' in social['title']:
                        item['facebook_link'] = social['href']

            locations_div = soup.find('span', {'class': 'pl-partner-locations'})
            if locations_div:
                locations = locations_div.find_all('li')
                for loc in locations:
                    for span in loc.find_all('span', {'id': True}):
                        if 'rptLocList:0' in span['id']:
                            item['locations_address'] = span.text
                        elif 'rptLocList:1' in span['id']:
                            item['locations_country'] = span.text
                        elif 'rptLocList:2' in span['id']:
                            item['general_phone_number'] = span.text
                    yield item
            else:
                yield item
